import React from 'react'


export default class Textinput extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            checked: 'false'
        }
    }



    render() {
        return (
            <div>
                <form>
                    <label>Answer: </label>
                    {<input type="text" onChange={this.props.onChange} />}
                </form>
            </div>
        )
    }
}
